sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...

  function getObjects(obj, key, val, newVal) {
    var newValue = newVal;
    var objects = [];
    for (var i in obj) {
        if (!obj.hasOwnProperty(i)) continue;
        if (typeof obj[i] == 'object') {
            objects = objects.concat(getObjects(obj[i], key, val, newValue));
        } else if (i == key && obj[key] == val) {
            obj[key] = 'qwe';
        }
    }
    return obj;
}

  var jsonObj = JSON.parse(inputs.gbbinput_in);

  var newJsonObj = getObjects(jsonObj, 'u_request_type', 'type2', 'type3');


  outputs.gbbinput = newJsonObj;

})(inputs, outputs);

